// src/components/Weather.js
import React, { useState, useEffect } from "react";
import { getWeather } from "../services/weatherService"; // fixed path

function Weather() {
  const [data, setData] = useState(null);

  useEffect(() => {
    // call your service
    getWeather("Delhi")
      .then((res) => setData(res))
      .catch((err) => console.error(err));
  }, []);

  return (
    <div>
      {data ? (
        <div>{data.city}: {data.temperature}</div>
      ) : (
        "Loading..."
      )}
    </div>
  );
}

export default Weather;
